import React, { useEffect } from 'react'
import { Outlet, useNavigate } from 'react-router-dom'

export default function Error() {
    const navigate = useNavigate()

    const goArticles = () => {
        // articles 경로로 이동
        navigate('/')
    }

    useEffect(() => {
        goArticles()
    })

    return <div>erro</div>
}
